import "./Card.css";

function Card(props) {
  const classes = "card" + props.className; // 因為card是自定義的tag，要把className告訴card div才會知道，才能吃到css設定
  return <div className={classes}>{props.children}</div>; //children 是react內建的
}

export default Card;
